import React from "react";
import type { BoardData, Column } from "../types/types";


interface ColumnProps {
    column: Column;
    board: BoardData;   
    setBoard: React.Dispatch<React.SetStateAction<BoardData>>;
}

const Column: React.FC<ColumnProps> = ({column, board, setBoard}) =>{
    return (
        <div
        style={{
            background: "#f4f4f4",
            padding: "10px",
            width: "250px",
            borderRadius: "10px",
        }}
        >
            <h2>{column.title}</h2>
            <ul>
                {column.issues.map((task) =>(
                    <li key={task.id}>{task.name}</li>
                ))}
            </ul>
            <button>+ Add card</button>
        </div>
    )
}

export default Column;
